import SignatureDish from "./SignatureDish";
import Chefs from "./Chefs";
import "./HomePage.scss";
import claro from "../../assets/claro.png";
import lumina from "../../assets/mizlala-gret-mullet-fillet.png";
import tiger from "../../assets/screen-shot-2019-01-06-at-10-57-26.png";
import padKiMao from '../../assets/rectangle_2.png';
import garbanzo from '../../assets/rectangle_3.png';
import pizza from '../../assets/screen-shot-2019-01-06-at-10-57-26.png';
import vegiterian from '../../assets/vegiterian-icon.png';
import spicy from '../../assets/group-2.png';
import yossi from '../../assets/rectangle.png';
import { Fragment, useState } from "react";

const dummy = [
  {
    key: "m1",
    restaurantImage: claro,
    restaurantName: "Claro",
    chefName: "Ran Shmueli",
    chefDescription: "",
    chefImage: "",
    signatureName: "pad Ki Mao",
    signatureImage: padKiMao,
    signatureDescription: "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
    icon: vegiterian,
    price: 66,
  },
  {
    key: "m2",
    restaurantImage: lumina,
    restaurantName: "Lumina",
    chefName: "Meir Adoni",
    chefDescription: "",
    chefImage: "",
    signatureName: "garbanzo",
    signatureImage: garbanzo,
    signatureDescription: "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
    icon: vegiterian,
    price: 25,
  },
  {
    key: "m3",
    restaurantImage: tiger,
    restaurantName: "Tiger Lilly",
    chefName: "Yanir Green",
    chefDescription: "",
    chefImage: "",
    signatureName: "pizza",
    signatureImage: pizza,
    signatureDescription: "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
    icon: spicy,
    price: 45,
  },
  {
    key: "m4",
    restaurantImage: tiger,
    restaurantName: "Onza",
    chefName: "Yossi Shitrit",
    chefDescription: "Chef Yossi Shitrit has been living and breathing his culinary dreams for more than two decades, including  running the kitchen in his first restaurant, the fondly-remembered  Violet, located in Moshav Udim.  Shitrit's creativity and culinary acumen  born of long experience are expressed in the every detail of each and every dish.",
    chefImage: yossi,
    signatureName: "pizza",
    signatureImage: pizza,
    signatureDescription: "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
    icon: spicy,
    price: 45,
  },
];

const DummyData = () => {
  const [isYossi, setIsYossi]= useState(false);
dummy.map(obj=> {if(obj.chefName === 'Yossi Shitrit') {setIsYossi(true)}})

  return (
    <Fragment>
      <p>THE POPULAR RESTAURANTS IN EPICURE : </p>
      <div className="data-container">
        <PopularRestaurant populars={dummy}></PopularRestaurant>
      </div>
      <p>SIGNATURE DISH OF :</p>
      <div className="data-container">
        <SignatureDish signatures={dummy}></SignatureDish>
      </div>
      {isYossi && (<div className="data-container">
        <Chefs chefs={dummy}></Chefs>
      </div>)}
    </Fragment>
  );
};


export default DummyData;
